class Player {
    private _assets: number
    private _bankrupt: boolean
    private _glassesMade: number
    private _glassesSold: number
    private _name: string
    private _price: number
    private _signs: number

    /**
     * Default constructor
     * @param {string} name - Name of player
     */
    constructor(name: string) {
        this._assets = currGame.prices[PRICE_INDEX_BEGINNING_ASSETS]
        this._bankrupt = false
        this._glassesMade = 0
        this._glassesSold = 0
        this._name = name
        this._price = 0
        this._signs = 0
    }   // constructor()

    /**
     * Getters and setters
     */
    //% callInDebugger
    public get assets(): number {
        return this._assets
    }   // get assets()

    //% callInDebugger
    public get bankrupt(): boolean {
        return this._bankrupt
    }   // get bankrupt()

    //% callInDebugger
    public get expenses(): number {
        if (this._bankrupt) {
            return 0
        } else {
            return this._glassesMade * currGame.lemonadeCost +
                this._signs * currGame.prices[PRICE_INDEX_SIGN_COST]
        }   // if (this._bankrupt)
    }   // get expenses()

    //% callInDebugger
    public get glassesMade(): number {
        return this._glassesMade
    }   // public get glassesMade()

    public set glassesMade(value: number) {
        if (value >= 0) {
            this._glassesMade = value
        }   // if (value)
    }   // set glassesMade()

    //% callInDebugger
    public get glassesSold(): number {
        return this._glassesSold
    }   // get glassesSold()

    //% callInDebugger
    public get hasEnoughAssets(): boolean {
        return this._assets >= this.expenses
    }   // get hasEnoughAssets()

    //% callInDebugger
    public get name(): string {
        return this._name
    }   // get name()

    //% callInDebugger
    public get net(): number {
        return this._bankrupt
            ? 0
            : this.revenue - this.expenses
    }   // get net()

    //% callInDebugger
    public get price(): number {
        return this._price
    }   // get price()

    public set price(value: number) {
        this._price = value
    }   // set price()

    //% callInDebugger
    public get priceString(): string {
        // Presume integer prices are in cents
        // and floating-point prices are in dollars
        let price =
            this._price != Math.floor(this._price)
                ? this._price * 100
                : this._price
        return price < 100
            ? price + 'c'
            : numberToUsCurrency(price / 100)
    }   // get priceString()

    //% callInDebugger
    public get revenue(): number {
        if (this._bankrupt) {
            return 0
        } else {
            // Presume integer prices are in cents
            // and floating-point prices are in dollars
            let price =
                this._price != Math.floor(this._price)
                    ? this._price
                    : this._price / 100
            return this._glassesSold * price
        }   // if (this._bankrupt)
    }   // get revenue()

    //% callInDebugger
    public get signs(): number {
        return this._signs
    }   // get signs()

    public set signs(value: number) {
        if (value >= 0) {
            this._signs = value
        }   // if (value)
    }   // set signs()

    /**
     * Public functions
     */
    public beginDay(): void {
        this._assets += this.net
        if (this._assets < currGame.lemonadeCost) {
            this._bankrupt = true
            this._glassesMade = 0
            this._glassesSold = 0
            this._price = 0
            this._signs = 0
        }   // if (! this._assets)
    }   // beginNewDay()

    public endDay(): void {
        // Calculate number of glasses sold
        // Uses Charlie Kellner's algorithm
        if (currGame.weather === Weather.Thunderstorm) {
            this._glassesSold = 0
        } else if (currGame.workersBoughtAll) {
            this._glassesSold = this._glassesMade
        } else {
            let threshold: number = currGame.prices[PRICE_INDEX_HIGH_PRICE_LIMIT]
            let n: number =
                this._price >= threshold
                    ? threshold ** 2 * GLASSES_SOLD_BASELINE / this._price ** 2
                    : (threshold - this._price) / threshold * 0.8 * GLASSES_SOLD_BASELINE + GLASSES_SOLD_BASELINE
            let v: number = 1 - Math.exp(-this._signs * SALES_FACTOR_SIGNS)
            let weatherFactor: number = 1
            if (currGame.workers) {
                weatherFactor = SALES_FACTOR_WORKERS
            } else {
                switch (currGame.weather) {
                    case Weather.Cloudy:
                        weatherFactor = 1 - currGame.chanceRain / 100
                        break

                    case Weather.Hot:
                        weatherFactor = 2
                        break
                }   // switch (currGame.weather)
            }   // if (currGame.workers)
            let sold: number = Math.floor(weatherFactor * (n + n * v))
            this._glassesSold =
                sold > this._glassesMade
                    ? this._glassesMade
                    : sold
        }   // if (currGame.weather ...)
    }   // endDay()
}   // class Player

function beginNewDay(): void {
    for (let p of currGame.players) {
        p.beginDay()
    }   // for (p)

    currGame.currDay++
    currGame.currPlayer = -1
    currGame.workers = false
    currGame.workersBoughtAll = false
    if (currGame.currDay < DAY_EVENTS_START) {
        currGame.weather = Weather.Sunny
        currGame.lemonadeCost = currGame.prices[PRICE_INDEX_LEMONADE_COST_1]
    } else if (currGame.currDay < DAY_MIX_INCREASE) {
        randomizeWeather()
        currGame.lemonadeCost = currGame.prices[PRICE_INDEX_LEMONADE_COST_2]
    } else {
        randomizeWeather()
        currGame.lemonadeCost = currGame.prices[PRICE_INDEX_LEMONADE_COST_3]
    }   // if (currGame.currDay ...)
    updateWeatherStatus()
    currGame.events = []
    switch (currGame.currDay) {
        case DAY_EVENTS_START:
            currGame.events.push(TEXT_NO_FREE_SUGAR)
            break

        case DAY_MIX_INCREASE:
            currGame.events.push(TEXT_MIX_INCREASE)
            break
    }   // switch (currGame.currDay)
    if (currGame.workers) {
        currGame.events.push(TEXT_WORKERS)
    }   // if (currGame.workers)
    let currEvent: string[]
    currEvent = []
    currEvent[0] = TEXT_COST_LEMONADE
    currEvent[1] = numberToUsCurrency(currGame.lemonadeCost)
    currGame.events.push(currEvent)
    currEvent = []
    currEvent[0] = TEXT_COST_SIGN
    currEvent[1] = numberToUsCurrency(currGame.prices[PRICE_INDEX_SIGN_COST])
    currGame.events.push(currEvent)
    currEvent = []
    currEvent[0] = weatherStatus.captions[0]
    currEvent[1] = weatherStatus.captions[1]
    currGame.events.push(currEvent)
}   // beginNewDay()

function buildSummary(): void {
    summaryText = []
    for (let index of summarySort) {
        let player: Player = currGame.players[index]
        let summary: string = ''
        summary += stringOfWidth(player.name, 5, false)
        summary += stringOfWidth(player.glassesMade.toString(), 3, true)
        summary += '  '
        summary += stringOfWidth(player.glassesSold.toString(), 3, true)
        summary += '  '
        summary += stringOfWidth(player.priceString, 5, true)
        summary += ' '
        summary += stringOfWidth(player.signs.toString(), 3, true)
        summaryText.push(summary)

        summary = '          '
        summary += stringOfWidth(numberToUsCurrency(player.net), 7, true)
        summary += '  '
        summary += stringOfWidth(numberToUsCurrency(player.assets + player.net), 7, true)
        summaryText.push(summary)
    }   // for (index)
    summaryStatus.currString = 0
    summaryStatus.done = false
}   // buildSummary()

function drawInstructions(img: Image, bgColor: number, beginY: number, maxY: number): void {
    drawText(instructionsStatus, TEXT_INSTRUCTIONS, img, bgColor, beginY, maxY)
}   // drawInstructions()

function drawText(currStatus: TextStatus, text: string[], img: Image, bgColor: number, beginY: number, maxY: number): void {
    img.fillRect(0, beginY, img.width, maxY, bgColor)
    let fi: FontInfo = drawStrings.createFontInfo(FontName.Font8)
    currStatus.currCharacter = drawStrings.writeWrapped(
        text[currStatus.currString], img,
        0, beginY, img.width - 1, maxY, TextAlignment.Left,
        COLOR_INSTRUCTIONS_TEXT, fi, currStatus.currCharacter)
    if (currStatus.currCharacter === -1) {
        currStatus.currCharacter = 0
        currStatus.currString++
        if (currStatus.currString >= text.length) {
            currStatus.done = true
        }   // if (currStatus.currString > text.length)
    }   // if (! currStatus.currCharacter)
}   // drawText()

function drawSummary(img: Image, bgColor: number, beginY: number, maxY: number): void {
    summaryStatus.currString = writeMultiple(summaryText, img, 0, beginY, COLOR_SUMMARY_TEXT,
        image.font8, maxY, 0, summaryStatus.currString)
    if (summaryStatus.currString === -1) {
        summaryStatus.currString = 0
        summaryStatus.done = true
    }   // if (! summaryStatus.currString)
}   // drawSummary()

function endCurrentDay(): void {
    for (let p of currGame.players) {
        p.endDay()
    }   // for (p)
    sortPlayers()
    buildSummary()
}   // endCurrentDay()

function hideWeatherCaption(): void {
    weatherStatus.captionSprite.y = 0 - weatherStatus.captionImage.height
}   // hideWeatherCaption()

function initGame(numPlayers: number, numDays: number, pricingScheme: number) {
    currGame = {
        chanceRain: 0,
        currDay: 0,
        currPlayer: 0,
        dataEntryDone: false,
        events: [],
        lemonadeCost: 0,
        maxDays: numDays,
        numPlayers: numPlayers,
        players: [],
        prices: PRICES[pricingScheme],
        weather: Weather.None,
        workers: false,
        workersBoughtAll: false
    }
    if (playerOptions == null) {
        playerOptions = new OptionScreen([], COLOR_PLAYER_OPTIONS_NAME_TEXT,
            [], COLOR_PLAYER_OPTIONS_EVENTS_TEXT,
            [], COLOR_PLAYER_OPTIONS_MAIN_TEXT, true)
        playerOptions.midText.font = image.font8
    }   // if (! playerOptions)
    if (weatherStatus == null) {
        weatherStatus = {
            backgrounds: [],
            captionImage: image.create(screen.width, 40),
            captions: [TEXT_WEATHER_REPORT_HEADING, '',
                TEXT_WEATHER_CONTINUE],
            captionSprite: null,
            currImage: 0
        }
        let sprite: Sprite = sprites.create(weatherStatus.captionImage)
        weatherStatus.captionSprite = sprite
        hideWeatherCaption()
    }   // if (! weatherStatus)
    summarySort = []
    for (let index: number = 0; index < numPlayers; index++) {
        summarySort.push(index)
    }   // for (index)
}   // initGame()

function numberToUsCurrency(value: number): string {
    let prefix: string = '$'
    if (value < 0) {
        prefix = '-$'
        value = Math.abs(value)
    }   // if (value < 0)
    let dollars: number = Math.floor(value)
    let cents: number = Math.floor(value * 100) % 100
    if (cents < 10) {
        return prefix + dollars + '.0' + cents
    } else {
        return prefix + dollars + '.' + cents
    }   // if (cents < 10)
}   // numberToUsCurrency()

