function playWeatherSong(playThunder: boolean = false): void {
    let weather: Weather =
        currGame.weather === Weather.Thunderstorm && !playThunder
            ? Weather.Cloudy
            : currGame.weather

    switch (weather) {
        case Weather.Cloudy:
            playCloudy()
            break

        case Weather.Hot:
            playHot()
            break

        case Weather.Sunny:
            playSunny()
            break

        case Weather.Thunderstorm:
            playThunderstorm()
            break
    }   // switch (currGame.weather)
}   // playWeatherSong()

function randomizeWeather(): void {
    let weatherFactor: number = Math.randomRange(0, 99)
    if (weatherFactor < CHANCE_CLOUDY) {
        currGame.weather = Weather.Cloudy
        currGame.chanceRain = CHANCE_RAIN_MIN +
            Math.floor(Math.randomRange(0, CHANCE_RAIN_MAX - CHANCE_RAIN_MIN) / 10) * 10
        if (Math.percentChance(CHANCE_THUNDERSTORM)) {
            currGame.weather = Weather.Thunderstorm
        }   // if (Math.percentChance(CHANCE_THUNDERSTORM))
    } else if (weatherFactor < CHANCE_CLOUDY + CHANCE_HOT) {
        currGame.weather = Weather.Hot
    } else {
        currGame.weather = Weather.Sunny
        if (Math.percentChance(CHANCE_WORKERS)) {
            currGame.workers = true
            if (Math.percentChance(CHANCE_WORKERS_BUY_ALL)) {
                currGame.workersBoughtAll = true
            }   // if (Math.percentChance(CHANCE_WORKERS_BUY_ALL))
        }   // if (Math.percentChance(CHANCE_WORKERS))
    }   // if (weatherFactor < ...)
}   // randomizeWeather()

function rotateWeatherImage(): void {
    if (weatherStatus.backgrounds.length > 1) {
        weatherStatus.currImage++
        if (weatherStatus.currImage >= weatherStatus.backgrounds.length) {
            weatherStatus.currImage = 0
        }   // if (weatherStatus.currImage >= weatherStatus.backgrouns.length)
        scene.setBackgroundImage(weatherStatus.backgrounds[weatherStatus.currImage])
    }   // if (weatherStatus.backgrounds.length)
}   // rotateWeatherImage()

function selectPlayerOption(): void {
    let currPlayer: Player = currGame.players[currGame.currPlayer]
    if (playerOptions.cursor.isInFooter) {
        if (currPlayer.hasEnoughAssets || currPlayer.bankrupt) {
            playerOptions.select()
        }   // if (currPlayer.hasEnoughAssets)
    } else {
        if (!currPlayer.bankrupt) {
            switch (playerOptions.cursor.currOption) {
                case 0:
                    currPlayer.glassesMade = game.askForNumber(TEXT_MAKE_GLASSES, 3)
                    break

                case 1:
                    let price: number = game.askForNumber(TEXT_PRICE_PROMPT, 3)
                    if (price !== Math.floor(price)) {
                        // Price included a decimal point
                        price *= 100
                    }   // if (price <> Math.floor(price))
                    if (price < currGame.lemonadeCost * 100) {
                        game.splash(TEXT_PRICE_TOO_LOW +
                            ' ' + numberToUsCurrency(currGame.lemonadeCost))
                    }   // if (price < currGame.lemonadeCost * 100)
                    currPlayer.price = price
                    break

                case 2:
                    currPlayer.signs = game.askForNumber(TEXT_MAKE_SIGNS, 2)
                    break
            }   // switch (playerOptions.cursor.currOption)
            updatePlayerOptions(currPlayer)
            playerOptions.rebuild()
            playerOptions.refresh()
        }   // if (! currPlayer.bankrupt)
    }   // if (playerOptions.cursor.isInFooter)
}   // selectPlayerOption()

function showCurrPlayerOptions(): void {
    if (currGame.currPlayer >= currGame.players.length) {
        let name: string = game.askForString(TEXT_PLAYER + ' ' + (currGame.currPlayer + 1) +
            ' ' + TEXT_PLAYER_NAME_INSTRUCTIONS)
        if (name.isEmpty()) {
            name = (currGame.currPlayer + 1).toString()
        }   // if (! name)
        let player: Player = new Player(name)
        currGame.players.push(player)
    }   // if (currGame.currPlayer >= currGame.players.length)
    let currPlayer: Player = currGame.players[currGame.currPlayer]
    if (currPlayer.price < currGame.lemonadeCost * 100) {
        currPlayer.price = currGame.lemonadeCost * 100
    }   // if (currPlayer.price < currGame.lemonadeCost)
    playerOptions.setTitles([currPlayer.name])
    playerOptions.headlines.data = currGame.events
    updatePlayerOptions(currPlayer)
    playerOptions.build()
}   // showCurrPlayerOptions()

function showWeather(showThunder: boolean = false): void {
    if (currGame.weather === Weather.Thunderstorm && showThunder) {
        weatherStatus.backgrounds = IMGS_THUNDER
        weatherStatus.captions[1] = TEXT_WEATHER[Weather.Thunderstorm]
        updateWeatherCaption()
    }   // if (currGame.weather === Weather.Thunderstorm ...)
    scene.setBackgroundImage(weatherStatus.backgrounds[0])
    weatherStatus.currImage = 0
    weatherStatus.captionSprite.y = SPRITE_Y_WEATHER_CAPTION
    playWeatherSong(showThunder)
    weatherStatus.captionImage.printCenter(weatherStatus.captions[2], 31,
        COLOR_WEATHER_TEXT, image.font8)
}   // showWeather()

function sortPlayers(): void {
    // Sort players in descending order by end-of-day value
    if (summarySort.length > 1) {
        summarySort.sort(function (value1, value2) {
            let player1: Player = currGame.players[value1]
            let player2: Player = currGame.players[value2]
            let assets1: number = player1.assets + player1.net
            let assets2: number = player2.assets + player2.net
            return assets2 - assets1
        })
    }   // if (summarySort.length > 1)
}   // sortPlayers()

function stringOfWidth(text: string, maxWidth: number, padFront: boolean): string {
    if (text.length >= maxWidth) {
        return text.substr(0, maxWidth)
    } else {
        let toReturn: string = text
        for (let count: number = 0; count < maxWidth - text.length; count++) {
            if (padFront) {
                toReturn = ' ' + toReturn
            } else {
                toReturn += ' '
            }   // if (padFront)
        }   // for (count)
        return toReturn
    }   // if (text.length >= maxWidth)
}   // stringOfWidth()

function updatePlayerOptions(player: Player): void {
    let options: string[] = []
    options.push('Day ' + currGame.currDay + ' of ' + currGame.maxDays +
        ' ' + TEXT_ASSETS + ': ' + numberToUsCurrency(player.assets))
    if (player.bankrupt) {
        options.push('No decisions for you!')
    } else {
        let priceText: string =
            player.price > 99
                ? numberToUsCurrency(player.price / 100)
                : player.price + 'c'
        options.push(TEXT_MAKE_GLASSES + ': ' + player.glassesMade)
        options.push(TEXT_PRICE + ': ' + priceText)
        options.push(TEXT_MAKE_SIGNS + ': ' + player.signs)
    }
    playerOptions.midText.data = [options]
}   // updatePlayerOptions()

function updateWeatherCaption() {
    weatherStatus.captionImage.fill(0)
    weatherStatus.captionImage.printCenter(weatherStatus.captions[0], 0,
        COLOR_WEATHER_TEXT, image.font8)
    weatherStatus.captionImage.printCenter(weatherStatus.captions[1], 11,
        COLOR_WEATHER_TEXT, image.font8)
}   // updateWeatherCaption()

function updateWeatherStatus() {
    switch (currGame.weather) {
        case Weather.Cloudy:
        case Weather.Thunderstorm:
            weatherStatus.backgrounds = IMGS_CLOUDY
            weatherStatus.captions[1] = TEXT_WEATHER[Weather.Cloudy] + ' ' +
                currGame.chanceRain + '%'
            break

        case Weather.Hot:
            weatherStatus.backgrounds = IMGS_HOT
            weatherStatus.captions[1] = TEXT_WEATHER[Weather.Hot]
            break

        case Weather.Sunny:
            weatherStatus.backgrounds = IMGS_SUNNY
            weatherStatus.captions[1] = TEXT_WEATHER[Weather.Sunny]
            break
    }   // switch (currGame.weather)
    updateWeatherCaption()
}   // updateWeatherStatus()

function writeMultiple(text: string[], img: Image,
    x: number, y: number, color: number, font: image.Font,
    maxY: number = 0,
    spacing: number = 1, startIndex: number = 0)
    : number {
    let currY: number = y
    let toReturn: number = startIndex
    if (maxY === 0) {
        maxY = screen.height
    }   // if (! maxY)
    while (currY + font.charHeight <= maxY + 1 && toReturn < text.length) {
        img.print(text[toReturn], x, currY, color, font)
        currY += (font.charHeight + spacing)
        toReturn++
    }   // while (currY + font.charHight <= maxY + 1 ...)
    if (toReturn >= text.length) {
        toReturn = -1
    }   // if (toReturn >= text.length)
    return toReturn
}   // writeMultiple()
